import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#252525",
    padding: 20,
  },

  header: {
    paddingTop: 20,
    justifyContent: "space-between",
  },

  
  search: {
    flexDirection: "row",
    justifyContent: "space-between",
  },

  buttonsHeader: {
    height: 30,
    width: 30,
  },

  headerText: {
    color: "#F0EFF4",
    fontSize: 20,
  },

  content: {
    paddingTop: 20,
  },

  secao: {
    marginTop: 24,
  },

  title: {
    fontSize: 20,
    color:'white'
  },

  subtitle: {
    fontSize: 16,
    color:'white'
  },

});

export default styles;
